import React, { Component } from 'react'
import styled from 'styled-components'
import {device} from '../../DeviceLayout'
const NavBarComponent = styled.div`
    width: 100%;
    background-color: yellow;
    height: 60px;
    margin: auto;
`
const LeftNavBarLinkComponent = styled.div`
  float: left;
  font-size: 20px;
  margin: 20px;
  font-weight: 500;
  cursor: pointer;
`
const Logo = styled.div`
  display: inline-block;
  font-size 22px;
  margin: 20px;


`
class NavBar extends Component {
  render() {
    return (
      <NavBarComponent>
        <LeftNavBarLinkComponent>
          Buy
        </LeftNavBarLinkComponent>
        <LeftNavBarLinkComponent>
          Rent
        </LeftNavBarLinkComponent>
      </NavBarComponent>
    )
  }
}
export default NavBar
